//www.getty.edu/legal/copyright.html#logo\'> here</a>.</p>"]}},"summary":{"none":["<p>As the local parish church prepares for services, villagers and rural peasants make their way down the path. In the distance, fields, gently rolling hills, buildings, and groves of trees give shape to the landscape. The candlelit procession inside the church, as well as the candles held by the approaching villagers, suggest the celebration of Candlemas, a church holiday observed the second of February.   </p>\\n<p>An earlier owner probably cut the miniature from the lower border of the calendar of a book of hours. Despite its small size, Bening\'s landscape achieves a monumentality associated with larger contemporary panel paintings, where the genre of landscape painting was developing along similar lines.</p>"]},"thumbnail":[{"id":"https://media.getty.edu/iiif/image/8a6f3f55-a468-4331-a81a-17ac63b1242c/full/!600,600/0/default.jpg","type":"Image","format":"image/jpeg","label":{"none":["Recto"]},"service":[{"@id":"https://media.getty.edu/iiif/image/8a6f3f55-a468-4331-a81a-17ac63b1242c","@type":"ImageService2","profile":"level2"}]}],"provider":[{"id":"http://example.org/provider","type":"Agent","homepage":[{"id":"http://example.org/undefined/11","type":"unknown"}],"logo":[{"id":"https://www.getty.edu/global/images/getty_logo_primary_blk.png","type":"Image"}],"label":{"none":["Unknown"]}}],"partOf":[{"id":"https://media.getty.edu/iiif/manifest/746e6f6c-2540-43f3-93cd-15c9cf68d808","type":"Collection"}],"seeAlso":[{"id":"https://data.getty.edu/museum/collection/object/5b035cc5-ea9f-45df-a4eb-14ca0934df3a","type":"Dataset","profile":"https://static.getty.edu/contexts/linked.art/ns/v1.1.0/linked-art.json","format":"application/ld+json"}],"items":[{"id":"https://media.getty.edu/iiif/manifest/canvas/8a6f3f55-a468-4331-a81a-17ac63b1242c.json","type":"Canvas","height":3630,"width":6184,"rights":"http://creativecommons.org/publicdomain/zero/1.0/","metadata":[{"label":{"none":["Open Content Qu